import React, { useState, useEffect } from 'react';
import axios from 'axios';

const BookProcessor = () => {
    const [travellingData, setTravellingData] = useState([]);
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        // Fetch data from the API
        fetchData();
    }, []);

    const fetchData = async () => {
        const response = await axios.get('your_api_endpoint')
            .then(response => {
                setTravellingData(response.data);
                setLoading(false);
            })
            .catch(error => {
                console.error('Error fetching data:', error);
                setLoading(false);
            });
    };

    return (
        <div>
            <h1>Travelling Options</h1>
            {loading ? (
                <p>Loading...</p>
            ) : travellingData.length === 0 ? (
                <div className="row-cards">
                    {/* Display blurred cards */}
                    <div className="card bg-white shadow-md rounded-lg p-4 filter blur-md">
                        <h2>Destination</h2>
                        <p>Description</p>
                        {/* Add more fields as needed */}
                    </div>
                    <div className="card bg-white shadow-md rounded-lg p-4 filter blur-md">
                        <h2>Destination</h2>
                        <p>Description</p>
                    </div>
                    <div className="card bg-white shadow-md rounded-lg p-4 filter blur-md">
                        <h2>Destination</h2>
                        <p>Description</p>
                    </div>
                </div>
            ) : (
                <div className="row-cards">
                    {travellingData.map((travel, index) => (
                        <div key={index} className="card bg-white shadow-md rounded-lg p-4">
                            {/* Render dynamic card content based on travel data */}
                            <h2>{travel.destination}</h2>
                            <p>{travel.description}</p>
                            {/* Add more fields as needed */}
                        </div>
                    ))}
                </div>
            )}
        </div>
    );
};

export default BookProcessor;
